import * as React from "react";
import "./style.css";

function Card2() {
  return (

  <div className="e-card">

    <div className="e-card-title"><h4>Note Traker</h4> </div>
    <div className="e-card-image2">
  </div>
  <div className="e-card-content">
  <br></br>
  <a style={{display: "table-cell"}} href="https://github.com/MigsGithub/NoteTaker_APP_HW11" target="_blank" rel="noopener noreferrer"><h5>GitHub repository</h5></a> 
  <br></br>
  <a style={{display: "table-cell"}} href="https://migs-notetaking.herokuapp.com" target="_blank" rel="noopener noreferrer"><h5>Deployed version</h5></a> 
  </div>
</div>);
}

export default Card2;
